import "./App.css";
import "./index.css";
import Moscu from "./Images/moscu.jpg";

function App() {
  return (
    <div className="App bg-white">
      <img className="w-9/12 ms-48 h-11" src={Moscu} alt="moscu" />
    </div>
  );
}

export default App;
